extension DrawOnPathExtension on Canvas {
  void drawOnPath(
    Path path, {
    required double spacing,
    required int steps,
    required Color defaultColor,
    required Color stepCompletedColor,
  }) {
    final paint = Paint()..style = PaintingStyle.fill;

    final pathMetrics = path.computeMetrics();
    double distance = 0.0;
    int shapeCounter = 0; // Counter for shapes drawn

    for (final metric in pathMetrics) {
      while (distance < metric.length) {
        final tangent = metric.getTangentForOffset(distance);
        if (tangent == null) continue;

        final position = tangent.position;

        // Determine color based on steps completed
        if (shapeCounter < steps * 5) {
          paint.color = defaultColor;
        } else {
          paint.color = stepCompletedColor;
        }

        // Draw a circle for every shape
        drawCircle(this, position, paint);

        distance += spacing; // Move to the next position on the path
        shapeCounter++;
      }
      distance = 0.0; // Reset the distance for the next pathMetric
    }
  }

  void drawCircle(Canvas canvas, Offset position, Paint paint) {
    canvas.drawCircle(position, 10.0, paint); // Adjust the radius as needed
  }
}

